sys_variable_value.value:
(function execute(inputs, outputs) {
  // gs.info(inputs.indexFields)

  var indexFields = [
    {"name":"Description","value":"Requirements Checklist, to include Section 508"},
    {"name":"Pre-Solicitation","value":"contract-number-9999"}
  ]
  // tried with and without JSON stringify
  // harded coded for now
  outputs.index_fields = indexFields

  // was getting invalid uri this stops that
  outputs.base_url = inputs.baseUrl.trim()
  outputs.resource_path = inputs.resourcePath.trim()

  // removes red dot when simply typing them in the REST request
  outputs.client_id_header = "X-Client-Id"
  outputs.api_key_header = "X-API-Key"

  outputs.file_name = inputs.fileName
  outputs.file = "de6c5130db265110b1227ea5f3961989"
  outputs.classification = "Pre-Solicitation" // red dot also shows up when typed directly
  outputs.document_type = "003 - Requirements Package Documents (to include Req Checklist, Section 508, IGCE, etc)"

})(inputs, outputs);

